import React from 'react'
import Logo from '../../images/logo/logo.png';
import './Header.css';

const Header = () => {
  return (
    <nav className='nav-header'>
      <ul className='ul-header'>
          <div className='logo'>
            <img src={Logo} alt="" />
          </div>
          <li><a exact href='#home'>Home</a></li>
          <li><a exact href='#about'>About</a></li>
          <li><a exact href='#services'>Services</a></li>
          <li><a exact href='#contact'>Contact Us</a></li>
      </ul>
    </nav>
  )
}

export default Header
